async def girarSobreLlanta(angulo):
    await wait(1)
    # Funcion para hacer un giro precido (Proporcional) sobre una llanta
    if angulo >= prime_hub.imu.heading():
        while prime_hub.imu.heading() <= angulo:
            await wait(1)
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 + 60)
    else:
        while prime_hub.imu.heading() >= angulo:
            await wait(1)
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 + 60)
        while prime_hub.imu.heading() <= angulo:
            await wait(1)
            rightMotor.run((angulo + prime_hub.imu.heading()) * 9 + 60)
    rightMotor.hold()
    leftMotor.hold()

async def girarSobreEje(angulo):
    await wait(1)
    # Funcion para girar de forma precisa (P) sobre su propio eje
    if angulo >= prime_hub.imu.heading():
        while prime_hub.imu.heading() <= angulo:
            await wait(1)
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 + 60)
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 - 60)
    else:
        while prime_hub.imu.heading() >= angulo:
            await wait(1)
            leftMotor.run((angulo - prime_hub.imu.heading()) * 9 - 60)
            rightMotor.run((prime_hub.imu.heading() - angulo) * 9 + 60)
    await stopMotors()

async def detectIntersection():
    global lastDetected
    await wait(1)
    if await lineSensor.reflection() < sensorBlack + 1:
        if watch.time() - lastDetected > debounceTime:
            print('INTERSECCION DETECTADA')
            lastDetected = watch.time()
            return 1
    else:
        if await lineSensor.reflection() > sensorBlack:
            lastDetected = watch.time()
            return 0

async def startTurning():
    await wait(1)
    # Funcion del giro que hace el robot cuando inicia desde la zona de inicio
    # de la pista
    await driveBase.straight(135)
    while not await lineSensor.reflection() <= threshold:
        await wait(1)
        rightMotor.run(400)
    await driveBase.straight(90)
    while not await lineSensor.reflection() <= threshold:
        await wait(1)
        leftMotor.run(200)
    rightMotor.stop()

async def stopMotors():
    await wait(1)
    # Funcion para detener los motores
    rightMotor.brake()
    leftMotor.brake()

async def PIDLineFollow(kP, kI, kD, SPEED, LR, INTERSECTION):
    global error1, pFix, integral, iFix, derivative, lastError, dFix, correction
    await wait(1)
    while True:
        await wait(1)
        error1 = await lineSensor.reflection() - threshold
        pFix = error1 * kP
        integral = integral + error1
        iFix = integral * kI
        derivative = error1 - lastError
        lastError = error1
        dFix = derivative * kD
        correction = (pFix + iFix) + dFix
        if LR == 1:
            leftMotor.dc(SPEED + correction)
            rightMotor.dc(SPEED - correction)
        else:
            leftMotor.dc(SPEED - correction)
            rightMotor.dc(SPEED + correction)
        if INTERSECTION == 1:
            if await detectIntersection() == 1:
                await stopMotors()
                print('FINISHED')
                await wait(500)
                break
        else:
            break

