async def isFlowerOrDuck():
    global elementX
    await wait(1)
    # Funcion que determina gracias a la reflexion de luz del sensor, que
    # elemento del parque esta al lado suyo. guarda el valor y lo suma a una
    # variable para determinar que combinacion hay
    if await elementSensor.reflection() > 5 and await elementSensor.reflection() < 13:
        elementX = elementX + 1
        await prime_hub.speaker.beep(200, 100)
        print('FLOR', ' ', await elementSensor.reflection(), ' ', elementX)
    elif await elementSensor.reflection() >= 13 and await elementSensor.reflection() < 30:
        elementX = elementX + 4
        await prime_hub.speaker.beep(350, 100)
        print('PATO', ' ', await elementSensor.reflection(), ' ', elementX)
    else:
        pass

async def followLineUntil(rotation, kP, kI, kD, SPEED, LEFTRIGHT):
    global rotations
    await wait(1)
    leftMotor.reset_angle(0)
    rightMotor.reset_angle(0)
    rotations = 0
    while not rotations >= rotation:
        await wait(1)
        rotations = (leftMotor.angle() + rightMotor.angle()) / 2
        await PIDLineFollow(kP, kI, kD, SPEED, LEFTRIGHT, 0)
    await stopMotors()

